css:
@namespace url(http://www.w3.org/1999/xhtml);
/*Seven Familiar*/
/* i really want this to be global */
/*Images - pictures*/

#pet-headerPortrait-base {
    background: url("http://data.whicdn.com/images/259743642/large.jpg") -15px top no-repeat !important;
    background-size: auto 125px !important;
}
#pet-portrait {
    background: url("https://s-media-cache-ak0.pinimg.com/originals/2b/65/f1/2b65f1f8dbeb8ad6246be109aeee7246.gif") center no-repeat !important;
    background-size: auto 450px !important;
    height: 450px !important;
}
#pet-portrait > img[src*="/static/img/pet/icon/"] {
    display: none !important;
}
/*Infos*/

#pet-info-name:before {
    content: "Saeyoung Choi" !important;
    font-size: 20px !important;
}
#pet-info-name {
    font-size: 0 !important;
}
#pet-info-evolve > .on {
    font-size: 0 !important;
}
.pet-info-evolve-icon {
    font-size: 13px !important;
}
.pet-info-evolve-icon:after {
    content: " Saeyoung se a enamorado mas de ti";
}
#pet-info-racegender:before {
    content: "Humano" !important;
    font-size: 16px !important;
    line-height: 20px !important;
}
#pet-info-racegender {
    font-size: 0 !important;
    margin-top: 5px;
}
img[src*="/static/img/f.png"] {
    background: url("http://www.eldarya.es/static/img/m.png") !important;
    padding-left: 14px !important;
    padding-top: 0px !important;
    width: 0 !important;
    height: 0 !important;
    margin-bottom: 5px !important;
}
/*Comida - food*/

#pet-info-food > img {
    background: url("https://fotos.subefotos.com/eddb2d3f8d5d076c048b957f2e7a3ec4o.png") !important;
    background-size: 60px 60px !important;
    margin-top: -5px !important;
    padding-left: 60px !important;
    padding-top: 60px !important;
    width: 0 !important;
    height: 0 !important;
}
#pet-info-food {
    font-size: 0 !important;
}
#pet-info-food:before {
    content: " Honey Buddha Chips y Dr Pepper" !important;
    font-size: 16px !important;
}
#pet-info-food > span {
    font-size: 16px !important;
}
/*Seven en tu perfil*/

#player-display-pet {
    background: url("https://vignette3.wikia.nocookie.net/mystic-messenger/images/b/b2/707_render.png/revision/latest?cb=20160920004028") no-repeat;
    background-size: auto 100%;
    height: 560px !important;
    width: 200px !important;
}
#player-display-pet > img {
    display: none !important;
}

img[src="/i18n/static/fr/logo.png"] {
    width: 0;
    height: 0;
    background: url("https://fotos.subefotos.com/a210b79c744f1ba2b8a586be74edf2ebo.png");
    padding-left: 500px;
    padding-top: 205px;
    position: absolute;
    top: -0px;
    left: -70px;
}
